All-New Iron Manual 001 (2008) (Digital) (AnPymGold-Empire)

This single issue one-shot looks at Iron Man's various suits, toys, history, and much more. A fun illustrated guide, worth checking out if you are fan of the character.
Thanks to AnPymGold-Empire for the digital copy, please seed and enjoy. :-)

